        this.state = {
            categories: [
                {category: "jeans", prediction: "95%"}
            ]
        }
        }


    render() {
        return (
            <div>
                <h1>This is our prediction blah blah blah</h1>
                <h2>Confidence Prediction Table</h2>
            </div>
        )
    }
}



export default PredictionPage;
